import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Patch_notes() {

  const patch = () => {
    let url = window.location("https://euw.leagueoflegends.com/fr-fr/news/tags/patch-notes");
    document.getElementById('patch-notes').innerHTML = url;
  }
  
  return (
    <>
      <body id='patch-notes' className='patch-notes'>
        <button onClick={patch()} className="btn-patch btn--patch">Acc√©der aux notes de patch</button>
      </body>
      <Footer />
    </>
  )
}
